import { Box, Grid } from "@material-ui/core";
import React from "react";

function InfoCount({ infoCount }) {

    return (
        <>
            <Grid container item>
                {infosCount.map((item, key) => (
                    <Grid
                        key={key}
                        container
                        item
                        xs={12}
                        sm={6}
                        md={3}
                        direction="column"
                        alignItems="center"
                        spacing={1}
                    >
                        <Grid item>
                            <Title>{item.count}+</Title>
                        </Grid>
                        <Grid item>
                            <Title sm>{item.title}</Title>
                        </Grid>
                        <Box height="20px" />
                    </Grid>
                ))}
            </Grid>
        </>
    );
}

export default InfoCount;
